import React from 'react'
import styled from "styled-components"

const GenerateImageForm = () => {
  return (
    <From>
        <Top>
            <Title>Generate Image with prompt</Title>
                
            <Desc>Write your promt</Desc>
        </Top>
    </From>
  )
}

export default GenerateImageForm
